  02> HAWKES, Jocelyn Adderley m on 29.05.1953 to (1) WATSON, Edward Jacques
  b 03.08.1934
  b ** ** ****
  Jocelyn b. at Whangarei and m. at Otaki. She attended some 13 different schools in England during the
  war and, on her return to New Zealand, she was a boarder at New Plymouth Girls' High School for four
  years. She was a house prefect in her last year there.
  01> RAINE , Peter Anthony m on 23.06.1984 to (1)RITCHIE, Alison
  b 05.11.1953
  b 14.10.1951
  Peter is an orchardist and Alison is a teacher, Peter was educated at Waimea College, Richmond and
  Canterbury University. He travelled overseas for six years, mainly in the East, and on his return
  he worked on farms and orchards around New Zealand until his marriage. Peter and Alison are now
  living and working on the property which belonged to Alison's family.
  01> RAINE , Rohan
