  02> HAWKES, Jocelyn Adderley m on 15.02.1958 to (2)RAINE, Glyn Bulmer
  b 03.08.1934
  b 16.12.1931
  Jocelyn b. at Whangarei and m. at Nelson, Glyn, slo Richard Charles Thomas Raine and Gwendolyn Beatrice
  Mabel Saxton. Address: Champion Road, Richmond, Nelson.
  Jocelyn spent 30 years bringing up her family, helping on the farm, nursing her father for 13 years and
  assisting many disadvantaged teenage boarders. In 1986 Jocelyn was elected to the Waimea County Council
  and served for 2 1/2 years until amalgamation of Local Government moved her into Nelson City where she
  was re-elected to the City Council in 1989, 1992 and 1995. Glyn is farming on a property which has been
  in his mother's family since 1842 and is now semi-retired.
  01> RAINE, Christopher Charles m on 13.05.1989 to KING, Angela
  b 29.10.1958
  b 25.05. ****
  Christopher b. at Nelson. Address: 15 Wensley Road, Richmond, Nelson.
  Christopher is a builder and Angela is a real estate agent. Christopher was educated at Waimea
  College, Richmond. He was a Nelson and New Zealand representative basketball player until he went
  to live in Australia in 1978.
